import React, { useState } from 'react';

const Header = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  return (
    <header className="bg-white shadow-lg fixed w-full top-0 z-50">
      <div className="container mx-auto px-4 py-3">
        <div className="flex justify-between items-center">
          <div className="flex items-center">
            <div className="bg-gradient-to-r from-purple-600 to-blue-600 text-white px-3 py-2 rounded-lg font-bold text-xl">
              M3
            </div>
            <div className="ml-3">
              <h1 className="text-xl font-bold text-gray-800">M3 MANPOWER</h1>
              <p className="text-sm text-gray-600">Migrant Magnet Manpower</p>
            </div>
          </div>

          {/* Desktop Navigation */}
          <nav className="hidden md:flex space-x-8">
            <a href="#home" className="text-gray-700 hover:text-purple-600 transition">Home</a>
            <a href="#services" className="text-gray-700 hover:text-purple-600 transition">Services</a>
            <a href="#about" className="text-gray-700 hover:text-purple-600 transition">About Us</a>
            <a href="#gallery" className="text-gray-700 hover:text-purple-600 transition">Gallery</a>
            <a href="#contact" className="text-gray-700 hover:text-purple-600 transition">Contact</a>
          </nav>

          {/* Mobile Menu Button */}
          <button 
            className="md:hidden"
            onClick={() => setIsMenuOpen(!isMenuOpen)}
          >
            <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" />
            </svg>
          </button>
        </div>

        {/* Mobile Navigation */}
        {isMenuOpen && (
          <nav className="md:hidden mt-4 pb-4">
            <a href="#home" className="block py-2 text-gray-700 hover:text-purple-600">Home</a>
            <a href="#services" className="block py-2 text-gray-700 hover:text-purple-600">Services</a>
            <a href="#about" className="block py-2 text-gray-700 hover:text-purple-600">About Us</a>
            <a href="#gallery" className="block py-2 text-gray-700 hover:text-purple-600">Gallery</a>
            <a href="#contact" className="block py-2 text-gray-700 hover:text-purple-600">Contact</a>
          </nav>
        )}
      </div>
    </header>
  );
};

export default Header;
